import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'my-app';
  appHeroName = 'Drogfisher';

  onLike() {
    window.alert(`I like ${this.appHeroName}`);
  }
}

<app-hero [heroName]="appHeroName" (liked)="onLike()"></app-hero>
<span>{{heroCmp.name}}</span>
